当消费者到咖啡厅，快餐店，或者化妆品专柜等线下店铺购买时，可以上Carry APP分享自己的购物数据，并且获得CRE代币。通过这些，Carry平台能累计许多消费者的购物数据。Carry的数据库会可以供给广告商，他们能够更精准定位客户群并执行推广。CRE代币作为接收广告的奖励，广告主推广时可以同时把CRE代币发送给消费者。

虽然线下零售行业的支出规模是线上的10倍，其数据仍然没有被收集或整合。目前线上电商或广告主已经局域线上数据的分析工具或在使用线上数据执行线上推广战略。Carry项目的目标就是构建世界最大线下零售数据平台，并且赋予消费者对自身消费数据的所有权和销售权。

